Element premaNazivu(){
        try{
            String naziv = jTextField1.getText();
            Element eElementNaziv = null;
            NodeList nList = doc.getElementsByTagName("auto");
            for(int temp =0;temp<nList.getLength();temp++){
                Node nNode = nList.item(temp);
                if(nNode.getNodeType() == Node.ELEMENT_NODE){
                    Element eElement = (Element) nNode;
                    if(temp==99){
                        naziv = eElement.getElementsByTagName("naziv").item(0).getTextContent();
                        eElementNaziv = eElement;
                    }else{
                        String nezz =eElement.getElementsByTagName("naziv").item(0).getTextContent();
                        if(nezz.equals(naziv)){
                            naziv = nezz;
                            eElementNaziv = eElement;
                        }
                    }
                }
            }
            return eElementNaziv;
        }
        catch(Exception e){
            e.printStackTrace();
            return null;
        }
    }
